/* eslint-disable react-hooks/exhaustive-deps */
/* eslint-disable @typescript-eslint/no-unused-vars */
/* eslint-disable jsx-a11y/alt-text */

import Navbar from "../components/views/Navbar";
import Sidebar from "../components/views/Sidebar";
import Set from "react-icons";

// import "react-loader-spinner/dist/loader/css/react-spinner-loader.css";
const Home = () => {
	const src = "https://www.youtube.com/embed/d15DP5zqnYE";
	return (
		<div className="flex">
			<Sidebar activeLink="home" />
			<div className="w-full h-full">
				<Navbar />
				<div className="text-center">
					<h1 className="text-4xl mt-8" style={{ fontFamily: 'impact' }}>A new Web3 experience for
						all the true G`s out there</h1>
					<iframe
						className="mt-8"
						src={src}
						width='100%'
						height={'600px'}
						title="Youtube Player"
						frameBorder="2"
						allowFullScreen
					/>
				</div>
			</div>
		</div>
	);
};

export default Home;
